-- Create Database
create database utdb;
--Create Schema
create schema utdb;

--Facility

CREATE TABLE facility (
facility_id numeric,
bed_size numeric,
address_state char(50),
address_city char(50),
number_of_doctors numeric,
facility_level numeric,
primary key (facility_id)
);

--Demographics

CREATE TABLE demographics (
incident_id numeric NOT NULL,
facility_id numeric NOT NULL,
patient_age numeric,
patient_gender char(10),
patient_race char(60),
patient_ethnicity char(50),
primary key (incident_id),
Constraint demographics_fk_facility_id foreign key (facility_id)
	references facility (facility_id)
);

--EmergencyDept

CREATE TABLE EmergencyDept (
incident_id numeric NOT NULL,
facility_id numeric NOT NULL,
transfer char(10),
ed_discharge_status char(100),
injury_type char(50),
primary key (incident_id, facility_id),
Constraint ed_fk_facility_id foreign key (facility_id)
	references facility (facility_id),
Constraint ed_fk_incident_id foreign key (incident_id)
	references demographics (incident_id)

);

--Discharge

CREATE TABLE discharge (
incident_id numeric NOT NULL,
facility_id numeric NOT NULL,
discharge_status char(150),
length_of_stay numeric,
icu_days numeric,
medication char(5),
primary key (incident_id, facility_id),
Constraint discharge_fk_facility_id foreign key (facility_id)
	references facility (facility_id),
Constraint discharge_fk_incident_id foreign key (incident_id)
	references demographics (incident_id)

);

--Vitals

CREATE TABLE vitals (
incident_id numeric NOT NULL,
systolic_blood_pressure smallint,
pulse smallint,
respiration_rate smallint,
oxygen_saturation smallint,
temperature decimal,
primary key (incident_id),
Constraint vitals_fk_incident_id foreign key (incident_id)
	references demographics (incident_id)

);

--Payment_method

CREATE TABLE payment_method (
payment_type_id smallint NOT NULL,
payment_type char(50),
primary key (payment_type_id)

);

--Payment

CREATE TABLE payment (
incident_id numeric NOT NULL,
payment_type_id smallint NOT NULL,
amount numeric NOT NULL,
primary key (incident_id, payment_type_id),
Constraint payment_fk_incident_id foreign key (incident_id)
	references demographics (incident_id),
Constraint payment_fk_payment_type_id foreign key (payment_type_id)
	references payment_method (payment_type_id)

);

--Procedure_code

CREATE TABLE procedure_code (
procedure_code decimal NOT NULL,
procedure_code_description char(250),
primary key (procedure_code)

);

--Procedure

CREATE TABLE procedure (
incident_id numeric NOT NULL,
procedure_code decimal NOT NULL,
procedure_date date NOT NULL,
primary key (incident_id, procedure_code),
Constraint procedure_fk_incident_id foreign key (incident_id)
	references demographics (incident_id),
Constraint procedure_fk_procedure_code foreign key (procedure_code)
	references procedure_code (procedure_code)

);

--Diagnosis_code

CREATE TABLE diagnosis_code (
diagnosis_code char(50),
diagnosis_code_description char(250),
primary key (diagnosis_code)

);

--Diagnosis

CREATE TABLE diagnosis (
incident_id numeric NOT NULL,
diagnosis_code char(50) NOT NULL,
diagnosis_date date NOT NULL,
primary key (incident_id, diagnosis_code),
Constraint diagnosis_fk_incident_id foreign key (incident_id)
	references demographics (incident_id),
Constraint diagnosis_fk_diagnosis_code foreign key (diagnosis_code)
	references diagnosis_code (diagnosis_code)

);

--Comorbidity_code

CREATE TABLE comorbidity_code (
comorbidity_code decimal NOT NULL,
comorbidity_code_description char(100),
primary key (comorbidity_code)

);

--Comorbidity

CREATE TABLE comorbidity (
incident_id numeric NOT NULL,
comorbidity_code decimal NOT NULL,
comorbidity_date date NOT NULL,
primary key (incident_id, comorbidity_code),
Constraint comorbidity_fk_incident_id foreign key (incident_id)
	references demographics (incident_id),
Constraint comorbidity_fk_comorbidity_code foreign key (comorbidity_code)
	references comorbidity_code (comorbidity_code)

);

